window.bookSummaryJSON = "<p><b>Not many people get a second chance, let alone a second life.</b></p> <p>I died. Burnt in a prison cell I spent years of my life rotting away in.</p> <p>I had been beaten, battered, and bruised beyond repair...but not broken. Never broken.</p> <p>By whatever miracle, I've been brought back ten years into my past and before I was locked away...</p> <p>But to a different kind of hell… Wensridge Academy. A place filled with only memories of pain and suffering.</p> <p>This time, I'll break the wheel of misfortune and with it, all the people who caused my suffering and death.</p> <p>This time I'll have the life I should have always had.</p> <p>The Blackened Blade <i>is the first in a new paranormal why-choose series. It's full of action, revenge, and five dark and damaged love interests that the FMC will not have to choose between. For mature listeners.</i></p>"; 
